/**
 * @param {number[]} heights
 * @param {number[][]} queries
 * @return {number[]}
 */
var leftmostBuildingQueries = function(heights, queries) {
    const n = heights.length;
    let ans = [];
    for (let [start, end] of queries) {
        if (start == end) {
            ans.push(start);
            continue;
        }
        let maxH = -1, idx = -1;
        for (let i = start + 1; i <= end; i++) {
            if (heights[i] > heights[start] && heights[i] > maxH) {
                maxH = heights[i];
                idx = i;
                break;
            }
        }
        if (idx != -1) {
            for (let i = idx + 1; i <= end; i++) {
                if (heights[i] > maxH) {
                    maxH = heights[i];
                    idx = i;
                }
            }
            ans.push(idx);
        } else {
            ans.push(-1);
        }
    }
    return ans;
};
